function Paragrafos({texto}) {
  return (
    <>
    
      <div className="row bg-primary" id="teste"> 
      <div style={{ marginBottom: '50 px' }}></div>
        <div className="col-2"></div>
        <div className="col-8 align-center text-white">
          <h1 className="text-white"
          style={{ fontWeight: 'bold' }} // Adicionando negrito aqui
          >Todos os projetos integrados das ETE's Conectados em um s√≥ Lugar</h1>
          <div style={{ marginBottom: '22px' }}></div>
          <p  className="text-white " style={{ fontSize: '20px' }}/>    <div style={{ marginBottom: '50 px' }}></div>
            <div className="col-2"></div>

            
        </div>
      </div>
      <div style={{ marginBottom: '22px' }}></div> 

      
    </>
  );
}

export default Paragrafos;
